import React from 'react';
import './Card.css';
import LargeComponent from '../Big2/LargeComponent';

const Card =(props)=> {
    const clases = 'card' + props.className
    return (
        <div className={classes}>
        <LargeComponent/>
        </div>
    )
}
export default Card;
